import { Fragment } from "react/cjs/react.production.min";


function Header(props) {
    
    return (
        <Fragment>
            <header>
                <h1>React Meals</h1>
                <button>Cart</button>
            </header>
            <div>
                <img src="./assets/meals.jpg" alt="Meals"/>
            </div>
        </Fragment>
    )
}

export default Header;
